    n = int(stdin.readline())
    edges = []
    for i in range(n - 1):
        u, v = list(map(int, stdin.readline().split()))
        edges.append((u, v))

    # dp[i] is the minimum number of edges you have to add to reach vertex i
    dp = [0] * (n + 1)
    dp[1] = 1

    # dp[i] = min(dp[j] + 1) for all j where j is a neighbor of i
    for i in range(n - 1):
        for j in range(1, n):
            if j in [u for u, v in edges]:
                continue
            if dp[j] == 0:
                continue
            if dp[i]!= 0 and dp[i] + 1 < dp[j]:
                dp[j] = dp[i] + 1

    return str(dp[n - 1])

