def solution(stdin: str) -> str:
    a, b = list(map(int, stdin.split()))

    # --- Write your code here ---
    count = 0

    while a!= b:
        if a % 2 == 0:
            a /= 2
        else:
            a += 1
        count += 1

    return str(count)
